def get_driver(driver_width=600, driver_height=300, limit=300):
    connections_attempted = 0
    while connections_attempted < limit:
        try:
            driver = webdriver.Chrome('chromedriver.exe')
            driver.set_window_size(driver_width, driver_height)
            #driver.minimize_window()
            return driver
        except:
            connections_attempted += 1
            print('Getting driver again...')
            print('  connections attempted: {}'.format(connections_attempted))
            print('  exception message: {}')
            traceback.print_exc()

def cleanhtml(raw_html):
  cleanr = re.compile('<.*?>')
  cleantext = re.sub(cleanr, '', raw_html)
  return cleantext

def scrape_donyaeqtesad_news_page(url):
    #url = 'https://donya-e-eqtesad.com/%D8%A8%D8%AE%D8%B4-%D8%A8%D9%88%D8%B1%D8%B3-6/3382667-%DB%8C%DA%A9-%D8%AF%D8%B1%D8%B5%D8%AF-%D8%B2%DB%8C%D8%A7%D9%86-%D8%AF%D8%B1-%D8%AF%D9%88-%D8%B1%D9%88%D8%B2'
    driver = get_driver()
    driver.get(url)
    soup = bs4.BeautifulSoup(driver.page_source)
    context = soup.findAll('div', {'id': "echo-detail"})
    context = unicode.join(u'\n', map(unicode, context))
    cleaned_context = cleanhtml((context)).strip()

    time = soup.findAll('time',{'class':'news-time'})
    time = str(time).split(' ')[2].split('=')[1][1:-1]

    mini_title = soup.findAll('div',{'class':'lead justify'})
    mini_title = unicode.join(u'\n', map(unicode, mini_title))
    cleaned_mini_title = cleanhtml((mini_title)).strip()
    overall_context = cleaned_mini_title + cleaned_context

    title = soup.find('h1',{'class':'title'})
    title = unicode.join(u'\n', map(unicode, title))
    cleaned_title = title.strip()
    return [time,cleaned_title,overall_context]

def scrape_link_page(url):
    doneq_links = []
    fars_links = []
    entekhab_links = []
    isna_links = []
    mehrnews_links = []

    #url = 'http://betasahm1.ir/recent-links/2019/07/'
    driver = get_driver()
    driver.get(url)
    soup = bs4.BeautifulSoup(driver.page_source)
    try:
        for ul in soup.findAll('ul'):
            for li in ul.findAll('li'):
                a = li.find('a')
                if(not('betasahm' in a['href'])):
                    if('donya' in a['href']):
                        doneq_links.append(a['href'])
                    else:
                        if('fars' in a['href']):
                            fars_links.append(a['href'])
                        else:
                            if('entekhab' in a['href']):
                                entekhab_links.append(a['href'])
                            else:
                                if('isna' in a['href']):
                                    isna_links.append(a['href'])
                                else:
                                    if('mehrnews' in a['href']):
                                        mehrnews_links.append(a['href'])
    except:
        print('end')
    links = [doneq_links,fars_links,entekhab_links,isna_links,mehrnews_links]
    return links


def genereate_betasahm_urls():
    urls = []
    base_url = 'http://betasahm1.ir/recent-links/'
    #2018:
    for i in range(12):
        if(i<9):
            urls.append(base_url+'2018/0'+str(i+1))
        else:
            urls.append(base_url + '2018/' + str(i + 1))
    #2019
    for i in range(7):
        urls.append(base_url + '2019/0' + str(i + 1))
    return urls

